		var x=move;
		var newPos = x+" "+height+" 0";
		document.getElementById("root").setAttribute('translation', newPos);

		var vp_x=move+30;
		var vp_y=height+85;
		var vp_Pos=vp_x+" "+vp_y+" 0";
		document.getElementById("vp2").setAttribute('position', vp_Pos);
		move += step;
		height += step_height;
		if(x>8000){
			alert("我飞太远，让我回来吧！");
			reset();			
		}
	}
	function rotate(){
		switch (flag){		
		case 0:
			flag=1;
			document.getElementById("time").setAttribute('enabled', 'true');
			break;
		case 1:
			alert("飞机已启动，请滑行！");
			break;
		case 2:
			alert("飞机已滑行，请加速！");
			break;
		case 3:
			alert("飞机已加速，请起飞！");
			break;
		case 4:
			alert("飞机飞行中！");
			break;
		default:
			alert("操作错误！");
		}				
	}
	function go(){
		switch (flag){		
		case 0:
			alert("飞机尚未启动！");
			break;
		case 1:
			flag=2;
			step_angle=0.3;
			document.getElementById("time").setAttribute('enabled', 'true');
			document.getElementById("time_move").setAttribute('enabled', 'true');
			break;
		case 2:
			alert("飞机已滑行，请加速！");
			break;
		case 3:
			alert("飞机已加速，请起飞！");
			break;
		case 4:
			alert("飞机飞行中！");
			break;
		default:
			alert("操作错误！");
		}		
	}
	function goFaster(){
		switch (flag){		
		case 0:
			alert("飞机尚未启动！");
			break;
		case 1:
			alert("飞机尚未滑行！");
			break;
		case 2:
			flag=3;
			step=8;
			step_angle=0.5;
			break;
		case 3:
			alert("飞机已加速，请起飞！");
			break;
		case 4:
			alert("飞机飞行中！");
			break;
		default:
			alert("操作错误！");
		}		
		//$("#route").remove();
		//$("scene").append("<Route id='route' fromNode='time_faster' fromField='fraction_changed' toNode='rotate' toField='set_fraction'></Route>");	
	}
    function fly(){
    	switch (flag){		
		case 0:
			alert("飞机尚未启动！");
			break;
		case 1:
			alert("飞机尚未滑行！");
			break;
		case 2:
			alert("飞机速度不够！");
			break;
		case 3:
			flag=4;
	    	step_height=5;
			break;
		case 4:
			alert("飞机飞行中！");
			break;
		default:
			alert("操作错误！");
		}
    	
    }
    function reset(){
    	 flag=0;
    	 step=2;
    	 move=0;
    	 step_angle=0.1;
    	 angle=0;
    	 height=0;
    	 step_height=0;
 		document.getElementById("time").setAttribute('enabled', 'false');
		document.getElementById("time_move").setAttribute('enabled', 'false');
		document.getElementById("root").setAttribute('translation', '-0 0 0');
		document.getElementById("screw").setAttribute('rotation', '0 -0.998 0.0573 -3.14');
		document.getElementById("vp2").setAttribute('position', '30 85 0');
		document.getElementById('vp1').setAttribute('set_bind','true');
		if(typeof(w)!="undefined")w.postMessage("reset");
    }
	$(document).ready(
			function() {
				if(typeof(Worker)!=="undefined")
		    	{
		    	  if(typeof(w)=="undefined")
		    	    {
		    	    w=new Worker("../js/time_worker.js");
		    	    }		    	  
		    	  w.onmessage = function (event) {    		  
		    		  if(event.data==1)rotate();
		    		  if(event.data==3)go();
		    		  if(event.data==9)goFaster();
		    		  if(event.data==15)fly();
		    		  //if(event.data>10)w.postMessage("stop");
		    	  };
		    	}
		    	else
		    	{
		    	alert("你的浏览器不支持一键启动，建议使用谷歌chrome浏览器，或国产百度浏览器！");
		    	}
			});
    function onekey(){
    	if(flag!=0){
    		alert("飞机正在执行任务中，请复位重试！");
    	}else{
    		w.postMessage("start");
    	}    	
    }
    function planevp(){
    	document.getElementById('vp2').setAttribute('set_bind','true');
    }
    </script>
</body>
</html>
